import React from 'react'
import DestinationList from './DestinationList'
import CatFactsList from './cats/CatSection'

export default function Content({places}) {
  return (
    <div className="content-div">
        <DestinationList places={places}/>
        <CatFactsList/>
    </div>
  )
}
